var pixels = ctx.getImageData(0, 0, image.width, image.height);
for (var i = 0; i < pixels.data.length; i += 4) {
  //check if the pixel is in a certain area to be removed
  //if so, set its alpha value to 0 (transparent)
  //for example, let's assume we want to remove pixels in the upper half of the image
  if (i / 4 < image.width * image.height / 2) {
    pixels.data[i + 3] = 0; //set alpha value to 0
  }
}
ctx.putImageData(pixels, 0, 0);

//set the canvas as the new image source
image.src = canvas.toDataURL();
